// src/components/TopNav.jsx
import React from "react";
import MenuBar from "./MenuBar"; // Import this
import { FaQuestionCircle, FaCog } from "react-icons/fa";

const TopNav = () => {
  return (
    <div className="flex items-center justify-between bg-[#232f3e] text-white px-4 py-3">
      <div className="flex items-center space-x-4">
        <MenuBar />
        <h1 className="font-semibold text-lg">amazon vendor central</h1>
      </div>
      <div className="flex items-center space-x-4">
        <FaQuestionCircle className="cursor-pointer" />
        <FaCog className="cursor-pointer" />
      </div>
    </div>
  );
};

export default TopNav;
